import React from "react";
import "../css/MatchDisplay.css";
import { BiError } from "react-icons/bi";
import { VcsTable } from "react-icons/vsc";
import { CSVLink } from "react-csv";

const MatchDisplay = ({ headers, errorRows, dataLength }) => {
  return (
    <div className="match-display">
      <div className="display-item">
        <BiError className="display-item-icon" />
        <h3>{errorRows.length} rows are missing a value</h3>
        <CSVLink
          style={{ textDecoration: "none" }}
          data={errorRows}
          className="export-button"
          filename="onboardingErrors"
        >
          Export Rows
        </CSVLink>
      </div>
      <div className="display-item">
        <VcsTable className="display-item-icon" />
        <h3>{dataLength - errorRows.length} / {dataLength} are being accepted</h3>
      </div>
      <div className="display-item"></div>
    </div>
  );
};

export default MatchDisplay;
